MongoDb Query returning unwanted documents<p>I have a database containing documents of two structures:</p>

<pre><code>{
  "name": "",
  "name_ar": "",
  "description": "",
  "bla1": {
    "name": "",
    "link": "",
    "Logo": ""
  },
  "bla2": {
    "name": "",
    "id": ""
  }
}
</code></pre>

<p>and</p>

<pre><code>{
  "name": "",
  "name_ar": "",
  "description": "",
  "bla1": {
    "name": [],
    "link": "",
    "Logo": ""
  },
  "bla2": {
    "name": "",
    "id": ""
  }
}
</code></pre>

<p>I want to query my collection to get documents with "bla1.name" exactly equal to something. However using the following query:</p>

<pre><code>{$and: [{'bla1.name': {'$type': 'string'}}, {"bla1.name":'something'}]}
</code></pre>

<p>returns all documents (even where "bla1.name" is an array) containing the name: 'something'.</p>

<p>What am I doing wrong?</p>

