Best way to handle non-existent sub-documents in MongoDB query results<p>I know this question has been asked before in some shape or form but I am looking for the best way to handle query results without a lot of if statements.</p>

<p>Let's say I am looking for a product (sub-document) in a package (document)</p>

<pre><code>Packages.find({_id : req.body.packId, "products._id" : req.body.prodId})
   .exec(function(err, result){
     if(err) throw err;

    // make sure the result array exists and is not empty

     if(result &amp;&amp; result.length &gt; 0) {

       // make sure product array exists and is not empty

        if(result.products &amp;&amp; result.products.length &gt; 0){
           res.json(result);
           }
          }
        });
</code></pre>

<p>I noticed I cannot do:</p>

<pre><code>if(result.products.length &gt; 0)
</code></pre>

<p>If there is no product, node will crash since it cannot determine 'length' of undefined.</p>

<p>My question is: Is there a better way to do this?</p>

