<p>So, fast forward and I run into a problem where I can't figure out how to edit an already existing Schema and add new keys into it.</p>

<p>For example, I have this Schema which represents a post(think Tweets or Facebook posts) that holds:</p>

<ul>
<li>A string that holds the body of the post</li>
<li>The id of the user that created the post</li>
<li>The Date of when the post was created </li>
