MongoDB multi document transaction, reading non commited data<p>Until <code>MongoDB v4.0</code>, multi document transactions were achieved by implementing a two phase commit.
After <code>4.0</code>, MongoDB has introduced the multi-document transactions for replica sets; As per their documentation; "until a transaction is committed, no write/update operations in the transaction are visible outside the transaction".
But what about the visibility of the data within the transaction scope?
For the sake of simplicity, I have implemented the example below, that depicts the case.</p>

<pre><code>            var client = new MongoClient("mongodb://localhost");
            var session = client.StartSession();
            var ColA = session.Client.GetDatabase("Testing").GetCollection&lt;BsonDocument&gt;("ColA");
            JObject Obj = new JObject();
            Obj.Add("A", "ValA");
            session.StartTransaction();
            ColA.InsertOne(session, BsonDocument.Parse(Obj.ToString()));
            var tt = ColA.Find(new BsonDocument { }).ToList();
            session.CommitTransaction();
</code></pre>

<p>In the origin, <code>"ColA"</code> is an empty collection, when I insert the document and then try to query it <code>(tt = ColA.Find...)</code>, the result set is still empty.
I understand that outside the transaction scope, the result set should remain empty until commit, but why is it empty inside the scope.</p>

<p>By reproducing the same scenario on SQL server, using the same logic, querying a table after an insertion within a transaction scope, returns data before commit.</p>

<p>Any Help is appreciated.</p>

